import React from "react";
import Navbar from "./Navbar"
import Card from "./Card"
import data from "./data"

export default function App() {
    const cardData = data.map(item => {
        return (
        <Card 
            key={item.id} 

        />
        )
    })
    return (
        <div>
            <Navbar />
            <div className="main--content">
                {cardData}
            </div>
        </div>
    )
}
